function openPopup(){
    var el = document.getElementById('popup');
    el.style.display = 'block';
    document.body.style.background = '#353333';
}

function openTab(evt, tabName) {
  var i, tabcontent, tablinks;
  tabcontent = document.getElementsByClassName("tabcontent");
  for (i = 0; i < tabcontent.length; i++) {
    tabcontent[i].style.display = "none";
  }
  tablinks = document.getElementsByClassName("tablinks");
  for (i = 0; i < tablinks.length; i++) {
    tablinks[i].className = tablinks[i].className.replace(" active", "");
  }
  document.getElementById(tabName).style.display = "block";
  evt.currentTarget.className += " active";
}

function generateOD(){
    var el = document.getElementById('popup');
    el.style.display = 'none';
    document.body.style.background = 'white';

var newCode = [];
var XStart = document.getElementsByClassName('OD_XStart')[0].value * 1;
var XEnd = document.getElementsByClassName('OD_XEnd')[0].value * 1;
var ZStart = document.getElementsByClassName('OD_ZStart')[0].value * 1;
var ZEnd = document.getElementsByClassName('OD_ZEnd')[0].value * 1;
var XClearance = document.getElementsByClassName('OD_XClearance')[0].value * 1;
var ZClearance = document.getElementsByClassName('OD_ZClearance')[0].value * 1;
var Layer = document.getElementsByClassName('OD_Layer')[0].value * 1;
var Speed = document.getElementsByClassName('OD_Speed')[0].value * 1;
var FeedRate = document.getElementsByClassName('OD_FeedRate')[0].value * 1;
newCode.push(';Spindle On\n');
newCode.push('M3 S'+Speed+'\n');
newCode.push(';Go to zero point\n');
newCode.push('G0 X' + Number.parseFloat(XStart+XClearance).toPrecision(4) + ' Z' + Number.parseFloat(ZStart+ZClearance).toPrecision(4) + ' F2000\n');
var i = XStart;
while ( i >= XEnd ) {
	newCode.push(';Layer\n');
	newCode.push('G0 X' + Number.parseFloat(i).toPrecision(4) +' Z' + Number.parseFloat(ZStart).toPrecision(4) + ' F'+FeedRate+'\n');
	newCode.push('G1 X' + Number.parseFloat(i).toPrecision(4) +' Z' + Number.parseFloat(ZEnd).toPrecision(4) + ' F'+FeedRate+'\n');
	newCode.push('G0 X' + Number.parseFloat(i+XClearance).toPrecision(4) +' Z' + Number.parseFloat(ZEnd).toPrecision(4) + ' F2000\n');
	newCode.push('G0 X' + Number.parseFloat(i+XClearance).toPrecision(4) +' Z' + Number.parseFloat(ZStart+ZClearance).toPrecision(4) + ' F2000\n');
	i -= Layer;
}
newCode.push(';Final Layer\n');
newCode.push('G0 X' + Number.parseFloat(XEnd).toPrecision(4) +' Z' + Number.parseFloat(ZStart).toPrecision(4) + ' F'+FeedRate+'\n');
newCode.push('G1 X' + Number.parseFloat(XEnd).toPrecision(4) +' Z' + Number.parseFloat(ZEnd).toPrecision(4) + ' F'+FeedRate+'\n');
newCode.push('G0 X' + Number.parseFloat(XEnd+XClearance).toPrecision(4) +' Z' + Number.parseFloat(ZEnd).toPrecision(4) + ' F2000\n');
newCode.push('G0 X' + Number.parseFloat(XEnd+XClearance).toPrecision(4) +' Z' + Number.parseFloat(ZStart+ZClearance).toPrecision(4) + ' F2000\n');
newCode.push(';Move to initial point\n');
newCode.push('G0 X' + Number.parseFloat(XStart+XClearance).toPrecision(4) + ' Z' + Number.parseFloat(ZStart+ZClearance).toPrecision(4) + ' F2000\n');
newCode.push(';Spindle Off\n');
newCode.push('M5\n');
window.ace.edit('editor').setValue(newCode.join(''));
document.getElementById("plot-file-btn").click();
}

function generateHSc(){
    var el = document.getElementById('popup');
    el.style.display = 'none';
    document.body.style.background = 'white';
var newCode = [];
var Radius = document.getElementsByClassName('HSc_Radius')[0].value * 1;
var XClearance = document.getElementsByClassName('HSc_XClearance')[0].value * 1;
var ZClearance = document.getElementsByClassName('HSc_ZClearance')[0].value * 1;
var Layer = document.getElementsByClassName('HSc_Layer')[0].value * 1;
var Speed = document.getElementsByClassName('HSc_Speed')[0].value * 1;
var FeedRate = document.getElementsByClassName('HSc_FeedRate')[0].value * 1;
var i,z,x;
var rMax = Math.sqrt( Math.pow(Radius, 2) * 2);
var r = rMax - Layer;
var sAn,stps;

newCode.push(';Spindle On\n');
newCode.push('M3 S'+Speed+'\n');
newCode.push(';Go to zero point\n');
newCode.push('G0 X0 Y0 Z0\n');
newCode.push('G0 X' + Number.parseFloat(Radius-Layer).toFixed(4) + ' Z' + Number.parseFloat(ZClearance).toFixed(4) + ' F2000\n');
while ( r > Radius ) {
    sAn = Math.acos(Radius/r);
    for (i=sAn;i<=Math.PI/2-sAn;i+= (Math.PI/2 - sAn * 2)/40){
        z = r * Math.cos(i);
        x = r * Math.sin(i);
       	newCode.push('G1 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');
	}
        z = r * Math.cos(Math.PI/2-sAn);
        x = r * Math.sin(Math.PI/2-sAn);
       	newCode.push('G1 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');

    newCode.push('G0 X' + Number.parseFloat(x+XClearance).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');

    sAn = Math.acos(Radius/(r+Layer));
    for (i=Math.PI/2-sAn;i>=sAn;i-= (Math.PI/2 - sAn * 2)/20){
        z = (r + Layer) * Math.cos(i);
        x = (r + Layer) * Math.sin(i);
       	newCode.push('G0 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F2000\n');
	}

        z = (r + Layer) * Math.cos(sAn);
        x = (r + Layer) * Math.sin(sAn);
       	newCode.push('G0 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F2000\n');

    newCode.push('G0 X' + Number.parseFloat(x-Layer*2).toFixed(4) +' Z' + Number.parseFloat(ZClearance).toFixed(4) + ' F30\n');

    r -= Layer;
}
    for (i=0;i<100;i++){
        z = Radius * Math.cos(Math.PI/(2*99)*i);
        x = Radius * Math.sin(Math.PI/(2*99)*i);
        newCode.push('G1 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');
    }

    newCode.push('G0 X' + Number.parseFloat(x+XClearance).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');
newCode.push(';Spindle Off\n');
newCode.push('M5\n');
window.ace.edit('editor').setValue(newCode.join(''));
document.getElementById("plot-file-btn").click();
}

function generateHSs(){
    var el = document.getElementById('popup');
    el.style.display = 'none';
    document.body.style.background = 'white';
var newCode = [];
var Radius = document.getElementsByClassName('HSc_Radius')[0].value * 1;
var XClearance = document.getElementsByClassName('HSc_XClearance')[0].value * 1;
var ZClearance = document.getElementsByClassName('HSc_ZClearance')[0].value * 1;
var Layer = document.getElementsByClassName('HSc_Layer')[0].value * 1;
var i,z,x;
var div_h=0;
var div_steps=70;
var rMax = Math.sqrt( Math.pow(Radius, 2) * 2);// + Math.sqrt( Math.pow(div_h, 2) * 2);
var r = rMax - Layer;
var sAn,stps;
newCode.push(';Go to zero point\n');
newCode.push('G0 X0 Y0 Z0\n');
newCode.push('G0 X' + Number.parseFloat(Radius-Layer).toFixed(4) + ' Z' + Number.parseFloat(ZClearance).toFixed(4) + ' F2000\n');
while ( r > Radius ) {
    sAn = Math.acos(Radius/r);
    for (i=sAn;i<=Math.PI/2-sAn;i+= (Math.PI/2 - sAn * 2)/40){
        z = r * Math.cos(i);
        x = r * Math.sin(i);
       	newCode.push('G1 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');
	}
        z = r * Math.cos(Math.PI/2-sAn);
        x = r * Math.sin(Math.PI/2-sAn);
       	newCode.push('G1 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');

    for(i=0;i>-div_steps+Radius;i--){
        x = Math.sin(i*2*Math.PI/28)-div_h/div_steps*i;
       	newCode.push('G1 X' + Number.parseFloat(x+r).toFixed(4) +' Z' + Number.parseFloat(i-Radius).toFixed(4) + ' F30\n');

    }
    newCode.push('G0 X' + Number.parseFloat(x+r+XClearance).toFixed(4) +' Z' + Number.parseFloat(i-Radius+1).toFixed(4) + ' F30\n');

    for(i=-div_steps+Radius;i<0;i++){
        x = Math.sin(i*2*Math.PI/28)-div_h/div_steps*i;
       	newCode.push('G0 X' + Number.parseFloat(x+r+XClearance).toFixed(4) +' Z' + Number.parseFloat(i-Radius+1).toFixed(4) + ' F30\n');
    }

    sAn = Math.acos(Radius/(r+Layer));
    for (i=Math.PI/2-sAn;i>=sAn;i-= (Math.PI/2 - sAn * 2)/20){
        z = (r + Layer) * Math.cos(i);
        x = (r + Layer) * Math.sin(i);
       	newCode.push('G0 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F2000\n');
	}

        z = (r + Layer) * Math.cos(sAn);
        x = (r + Layer) * Math.sin(sAn);
       	newCode.push('G0 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F2000\n');

    newCode.push('G0 X' + Number.parseFloat(x-Layer*2).toFixed(4) +' Z' + Number.parseFloat(ZClearance).toFixed(4) + ' F30\n');

    r -= Layer;
}
    for (i=0;i<100;i++){
        z = Radius * Math.cos(Math.PI/(2*99)*i);
        x = Radius * Math.sin(Math.PI/(2*99)*i);
        newCode.push('G1 X' + Number.parseFloat(x).toFixed(4) +' Z' + Number.parseFloat(z-Radius).toFixed(4) + ' F30\n');
    }

    for(i=0;i>-div_steps+Radius;i--){
        x = Math.sin(i*2*Math.PI/28)-div_h/div_steps*i;
       	newCode.push('G1 X' + Number.parseFloat(x+Radius).toFixed(4) +' Z' + Number.parseFloat(i-Radius).toFixed(4) + ' F30\n');

    }
    newCode.push('G0 X' + Number.parseFloat(x+Radius+XClearance).toFixed(4) +' Z' + Number.parseFloat(i-Radius+1).toFixed(4) + ' F30\n');

window.ace.edit('editor').setValue(newCode.join(''));
document.getElementById("plot-file-btn").click();
}

