function calculateAngle(){
var el = document.getElementsByClassName("Angle_Angle");
var XStart = document.getElementsByClassName('Angle_XStart')[0].value * 1;
var XEnd = document.getElementsByClassName('Angle_XEnd')[0].value * 1;
var ZStart = document.getElementsByClassName('Angle_ZStart')[0].value * 1;
var ZEnd = document.getElementsByClassName('Angle_ZEnd')[0].value * 1;
var XClearance = document.getElementsByClassName('Angle_XClearance')[0].value * 1;
var ZClearance = document.getElementsByClassName('Angle_ZClearance')[0].value * 1;
var Layer = document.getElementsByClassName('Angle_Layer')[0].value * 1;
el[0].value= Math.atan(Math.abs(XStart - XEnd )/Math.abs(ZStart - ZEnd )) * 180 / Math.PI;

}


